import React from 'react';
import DensityMediumIcon from '@mui/icons-material/DensityMedium';
import VideoCallIcon from '@mui/icons-material/VideoCall';
import { Link } from 'react-router-dom';
const HeaderPage = () =>{
 return ( 
       
    <div className="flex items-center w-full  h-[60px] bg-white fixed inset-x-0 top-0 shadow-md">
        <div>
            <Link to="#" className="flex justify-center items-center ml-4 mt-1 w-10 h-10 hover:bg-gray-300 rounded-full">
                <DensityMediumIcon />
            </Link>
        </div>
        <div className="mx-auto flex items-center">
        <input
            type="text"
            placeholder="Tìm kiếm"
            className=" w-[600px] h-[40px] px-2 py-1 pl-4 pr-4 border border-gray-300 rounded-full placeholder-gray-400 focus:outline-none focus:ring-1 focus:ring-blue-500 focus:border-blue-500 sm:text-sm"
        />
        </div>
        <div>
            <Link to="#" 
                className="flex justify-center items-center ml-4 mt-1 w-10 h-10 hover:bg-gray-300 rounded-full" 
                
                title="Tạo Video"
            > 
                <VideoCallIcon />
            </Link>
        </div>

    </div>
 );
    };
export default HeaderPage;
